class InsTalkerPy():
    def __init__(self,user_name_log,password):
        try:
            print(u'Iniciando WebDriver...')
            self.browser = webdriver.Firefox() #carregar navegador chrome
        except IOError:
            print(u'Não foi possivel carregar geckodriver.exe, favor verifique o arquivo. ( https://github.com/mozilla/geckodriver/releases ) ')
        self.user_name_log = user_name_log
        self.password = password

    def LogIn(self):
        print(u'Abrindo Pagina de Login...')
        print(u'Realizando login...')
        self.browser.get('https://www.instagram.com/accounts/login/')
        time.sleep(3)
        print(u'Inserindo Usuario...')
        self.browser.find_element_by_name("username").send_keys(self.user_name_log)
        print(u'Inserindo Senha...')
        self.browser.find_element_by_name("password").send_keys(self.password)
        self.browser.find_element_by_name("password").send_keys(Keys.ENTER)
        time.sleep(6)
        try:
            self.browser.find_element_by_id('slfErrorAlert')
            print(u'Falha ao realizar Login. Favor verificar seus dados.')
            return False
        except NoSuchElementException:
            print(u'Login realizado com Sucesso!')
            print(u'Removendo Pop-Up...')
            self.browser.find_element_by_class_name('aOOlW.HoLwm').click()
            print(u'Pop-Up removido.')

    def LogOut(self):
        print(u'Redirecionado a Pagina Principal para Proceder com Logout...')
        self.browser.get('https://www.instagram.com/'+self.user_name_log+'/')
        time.sleep(3)
        print(u'Abrindo Botão primario de LogOut...')
        self.browser.find_element_by_class_name('dCJp8.afkep._0mzm-').click()
        for elem in self.browser.find_elements_by_css_selector('button'):
            if 'Log Out' in elem.text:
                elem.click()
                print(u'Solicitação de LogOut Enviada')
                break
        print(u'LogOut realizado com sucesso!')

    def GetFollowers(self, user_foll):
        self.user_foll = user_foll
        print(u'Redirecionado a Pagina Principal Para a Coleta da Lista de Followers de ' + self.user_foll + u' ...')
        self.browser.get('https://www.instagram.com/' + self.user_foll + '/')
        print(u'Abrindo Lista de Followers de ' + self.user_foll + u' ...')
        list_foll = [] #define lista vazia de seguidores
        for elem in self.browser.find_elements_by_class_name('-nal3'):
            if 'followers' in elem.text:
                print(u'Coletando numero de seguidores de ' + self.user_foll + u' ...')
                n_followers = elem.text.replace(' followers','')#pega numero de seguidores
                n_followers = int(n_followers.replace(',',''))
                print(u'Número de Seguidores é igual a : '+str(n_followers))
                print(u'Abrindo Janela de Seguidores...')
                elem.click()
                time.sleep(3)
        print(u'Expandindo os seguidores exibidos an tela...')
        n_followers_exib = len(self.browser.find_elements_by_class_name('FPmhX.notranslate._0imsa'))
        self.browser.find_element_by_class_name("PZuss").click()
        time.sleep(1)
        actionChain = webdriver.ActionChains(self.browser)
        cont = 0
        while n_followers_exib <n_followers:
            actionChain.key_down(Keys.SPACE).key_up(Keys.SPACE).perform()
            time.sleep(3)
            if len(self.browser.find_elements_by_class_name('FPmhX.notranslate._0imsa')) == n_followers_exib:
                cont = cont + 1
            n_followers_exib = len(self.browser.find_elements_by_class_name('FPmhX.notranslate._0imsa'))
            if cont == 100:
                print(u'100 tentativas foram realizadas sem exito')
                break
            print(u'Número de seguidores exibidos é: '+str(n_followers_exib) +' ' +str(100*n_followers_exib/n_followers)+' %')
        print(u'Número de Seguidores exibito é igual ao total de: '+str(n_followers))
        print(u'Iniciar processo de coleta de Lista de Seguidores...')
        for elem in self.browser.find_elements_by_class_name('FPmhX.notranslate._0imsa'):
            #print(elem.get_attribute('title'))
            list_foll.append(elem.get_attribute('title'))
        print('A coleta foi realizada com sucesso!')
        print(u'A lista de seguidores é:')
        print(list_foll)
        return list_foll

    def UserIsPrivate(self, user_foll):
        self.user_foll = user_foll
        print(u'Verificando se Usuário é Privado...')
        self.browser.get('https://www.instagram.com/' + self.user_foll + '/')
        print(u'Abrindo Pagina do Usuário ' + self.user_foll)
        time.sleep(2)
        try:
            print(self.browser.find_element_by_class_name('rkEop').text)
            print('O Usuário é Privado!')
            return True
        except:
           print(u'O Usuário não é Privado!')
           return False

    def GetPicGalery(self,user_get):
        self.user_get = user_get
        print(u'Direcionando a Pagina do Usuário '+ self.user_get+u' ...')
        self.browser.get('https://www.instagram.com/' + self.user_get + '/')
        time.sleep(2)
        print(u'Coletanddo número de POSTS do úsuário...')
        for elem in self.browser.find_elements_by_class_name('-nal3'):
            if 'posts' in elem.text:
                print(u'Coletando numero de posts de ' + self.user_get + u' ...')
                n_posts = elem.text.replace(' posts','')#pega numero de seguidores
                n_posts = int(n_posts.replace(',',''))
                n_posts=n_posts
                print(u'Número de Posts é igual a : '+str(n_posts))
        print(u'Abrindo Primeira Imagem...')
        self.browser.find_elements_by_class_name('v1Nh3.kIKUG._bz0w')[0].click()
        self.browser.find_elements_by_class_name('v1Nh3.kIKUG._bz0w')[0].click()
        time.sleep(1)
        cont = 0
        list_link = []
        while cont< n_posts:
            print(u'Coletando o link da foto ('+str(cont+1)+'/'+str(n_posts)+') ...')
            elem = self.browser.find_elements_by_class_name('FFVAD')[cont].get_attribute('srcset')
            elem = elem.split(' ')
            elem = elem[len(elem)-2]
            elem = elem.split(',')
            elem = elem[len(elem)-1]
            print(u'Link coletado!')
            print(elem)
            list_link.append(elem)
            cont=cont+1
            print(u'Clicando para mover a proxima foto('+str(cont)+'/'+str(n_posts)+') ...')
            if cont == n_posts:
                break
            self.browser.find_element_by_class_name('HBoOv.coreSpriteRightPaginationArrow').click()
            time.sleep(4)
        print(u'Lista de links obtida com sucesso!')

        print(u'Criando pasta para realizar downlaods...')
        local = os.path.dirname(os.path.realpath(__file__))+r'\Downloads'+'\\'+self.user_get+'\\'
        print(u'Os arquivos serão baixados em: '+local+ ' ...')
        if os.path.isdir(local)== False:
            os.mkdir(local)
        print(u'Iniciando downloads...')
        cont = 1
        for elem in list_link:
            print(u'Realizando Download ('+str(cont)+'/'+str(n_posts)+')...')
            self.browser.get(elem)
            time.sleep(2)
            nome = elem.split('/')
            nome=nome[len(nome)-1]
            nome = nome.split('?')
            nome = nome[0]+'.png'
            self.browser.find_element_by_xpath('/html/body/img').screenshot(local+nome)
            print(u'Download realizado com sucesso...')
            cont = cont+1

    def LikeAll(self,user_get,n_likes,coment,texto):
        self.user_get = user_get
        self.user_n_likes = n_likes
        #comenta em uma foto aleatória
        self.coment = coment
        self.texto_coment = texto
        print(u'Direcionando a Pagina do Usuário '+ self.user_get+u' ...')
        self.browser.get('https://www.instagram.com/' + self.user_get + '/')
        time.sleep(3)
        print(u'Coletanddo número de POSTS do úsuário...')
        n_posts= self.browser.find_elements_by_xpath('/html/body/span/section/main/div/header/section/ul/li[1]/span/span')[0].text
        if ',' in n_posts:
            n_posts = n_posts.replace(',','')
        n_posts = int(n_posts)
        print(u'Número de Posts é igual a : '+str(n_posts))
        if self.user_n_likes == 0:
            self.user_n_likes = n_posts

        if n_posts>0:
            print(u'Abrindo Primeira Imagem...')
            self.browser.find_elements_by_class_name('v1Nh3.kIKUG._bz0w')[0].click()
            time.sleep(random.randint(2,7))
            cont = 0
            while cont< n_posts:
                if cont == 0:
                    print(u'Realizando comentário...')
                    self.browser.find_element_by_xpath('/html/body/div[2]/div[2]/div/article/div[2]/section[3]/div/form/textarea').click()
                    time.sleep(1)
                    self.browser.find_element_by_xpath('/html/body/div[2]/div[2]/div/article/div[2]/section[3]/div/form/textarea').send_keys(self.texto_coment)
                    time.sleep(1)
                    self.browser.find_element_by_xpath('/html/body/div[2]/div[2]/div/article/div[2]/section[3]/div/form/textarea').send_keys(Keys.ENTER)
                    time.sleep(random.randint(1,3))
                print(u'Comentário Realizado!')
                print(u'Realizando Like da Postagem ('+str(cont+1)+'/'+str(n_posts)+') ...')
                elem = self.browser.find_elements_by_xpath('/html/body/div[2]/div[2]/div/article/div[2]/section[1]/span[1]/button/span')[0].get_attribute('aria-label')
                if 'Like' in elem:
                    self.browser.find_element_by_class_name('fr66n').click()
                    time.sleep(random.randint(2,7))
                    print(u'Imagem curtida com sucesso!')
                else:
                    print(u'Imagem já curtida')
                cont=cont+1
                if (cont == n_posts) or (cont == self.user_n_likes):
                    break
                else:
                    print(u'Clicando para mover a proxima foto('+str(cont)+'/'+str(n_posts)+') ...')
                    self.browser.find_element_by_class_name('HBoOv.coreSpriteRightPaginationArrow').click()
                    time.sleep(random.randint(2,7))

